// Binary search the region lookup table with parent cell fallback
RegionId findRegion(uint8_t baseCell, uint16_t partialIndex) {
    // Try exact match first
    int low = 0;
    int high = REGION_ENTRY_COUNT - 1;
    
    while (low <= high) {
        int mid = (low + high) / 2;
        
        // Check base cell first (more significant)
        if (regionLookup[mid].baseCell < baseCell) {
            low = mid + 1;
        } else if (regionLookup[mid].baseCell > baseCell) {
            high = mid - 1;
        } else {
            // Base cells match, check partial index
            if (regionLookup[mid].partialIndex < partialIndex) {
                low = mid + 1;
            } else if (regionLookup[mid].partialIndex > partialIndex) {
                high = mid - 1;
            } else {
                // Found exact match
                return regionLookup[mid].regionId;
            }
        }
    }
    
    // No exact match - try parent cell (resolution 3 -> 2)
    uint16_t parentPartialIndex = partialIndex / 8;
    low = 0;
    high = REGION_ENTRY_COUNT - 1;
    
    while (low <= high) {
        int mid = (low + high) / 2;
        
        if (regionLookup[mid].baseCell < baseCell) {
            low = mid + 1;
        } else if (regionLookup[mid].baseCell > baseCell) {
            high = mid - 1;
        } else {
            if (regionLookup[mid].partialIndex < parentPartialIndex) {
                low = mid + 1;
            } else if (regionLookup[mid].partialIndex > parentPartialIndex) {
                high = mid - 1;
            } else {
                // Found parent match
                return regionLookup[mid].regionId;
            }
        }
    }
    
    // Try grandparent cell (resolution 2 -> 1)
    uint16_t grandparentPartialIndex = parentPartialIndex / 8;
    low = 0;
    high = REGION_ENTRY_COUNT - 1;
    
    while (low <= high) {
        int mid = (low + high) / 2;
        
        if (regionLookup[mid].baseCell < baseCell) {
            low = mid + 1;
        } else if (regionLookup[mid].baseCell > baseCell) {
            high = mid - 1;
        } else {
            if (regionLookup[mid].partialIndex < grandparentPartialIndex) {
                low = mid + 1;
            } else if (regionLookup[mid].partialIndex > grandparentPartialIndex) {
                high = mid - 1;
            } else {
                // Found grandparent match
                return regionLookup[mid].regionId;
            }
        }
    }
    
    // No match found at any resolution
    return 0; // Unknown/invalid region
}
